import React from 'react';
import TitleTextButton from '../TitleTextButton/TitleTextButton'
const componentList = [
    {
        title: "Welcome to Decentralize.io",
        titleFontSize: "48px",
        LineHeight: "58px",
        letterSpacing: "0.13px",
        text: "Create your own decentralized autonomous organisation (DAO) in minuets! Manage finances, fundraise, reward contributors and much more…",
        btnText: "Create Now",
        bgColor: "#DFDEDE",
        height: "376px",
        marginTop: "4px",
    },
    {
        title: "What is a DAO?",
        titleFontSize: "28px",
        LineHeight: "34px",
        letterSpacing: "0.07px",
        text: "A decentralized autonomous organisation is an entity with no central management. Regulated by a set of rules, it unites people in a new way.",
        btnText: "Create Now",
        bgColor: "#FFFFFF",
        height: "200px",
    }
]

const HomePage = (props) => {
    return (
        <div className="DI_homePage_main"> 
            {componentList.map((data,i)=>{
                return (
                    <TitleTextButton key={i} {...data} />
                )
            })

            }
        </div>
    )
}

export default HomePage;
